# -*- coding: utf-8 -*-

def gcd(a, b):
    if b == 0:
        return a
    else:
        return gcd(b, a % b)

def lcm(a, b):
    return a * b // gcd(a, b)

def main():
    k = int(input())

    ans = 0
    for a in range(1, k + 1):
        for b in range(1, k + 1):
            for c in range(1, k + 1):
                ans += gcd(a, b)
                ans += gcd(b, c)
                ans += gcd(c, a)
                ans += gcd(gcd(a, b), c) # 全ての場合を考える
    print(ans)

if __name__ == '__main__':
    main()

